  ---------------------------------------------------------------*/
DROP TABLE IF EXISTS `sex`;
CREATE TABLE `sex` (
  `kode_kelamin` varchar(20) NOT NULL,
  `jenis_kelamin` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`kode_kelamin`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
